import React from 'react';
import NewArticle from '../../assets/newArticle.svg';

const NewArticleComponent = () => (
  <div className="NewArticleComponent-Component">
    <img src={NewArticle} className="newArticle" alt="humanitarian" title="Create new article"/>
  </div>
);

export default NewArticleComponent;
